textOriginal:
Tentar impedir o avanço da direita com roda de conversa e mantendo-se na bolha fará com que sejamos dizimados em um futuro mais próximo do que pensamos!

Precisamos RADICALIZAR e aqui vai coisas pequenas, neste início, que começarei a fazer:

1 - Seguir todos os canais de esquerda no Youtube e apoiar financeiramente com o que puder, sempre dando like e comentando;
2 - Colocar uma bandeira do PT, ou partido que você siga, uma LGBT e uma do Brasil;
3 - Ter camisas, bonés, ecobag, bóton com mensagens atreladas à esquerda e não ter vergonha e/ou medo de usa-las;
4 - Sempre que ouvir alguém falando mal da esquerda posicionar-se! Eu cansei, ontem estava no ônibus e o motorista falou para outro: "Você votou no Lula, tinha que botar você e ele no paredão e fuzilar. Lula é ladrão!". Eu logo gritei: "Lula ladrão, roubou meu coração!". O cara automaticamente calou-se, claro que ficou puto, e vida que segue.
5 - Quem sempre teve vontade a hora é agora! Criar uma página no Instagram, canal no Youtube, Facebook, Snapchat, Blog, TikTok voltado à política ou até falando sobre algo, como por exemplo: decoração. Entretanto, posicionando-se sempre e falando de política. 
6 - Filie-se a um partido de esquerda E COMECE NA POLÍTICA! PRECISAMOS CRIAR NOVOS ROSTOS!

Se tiverem mais coloquem aqui nos comentários, por favor.

Abraço, amigos e amigas de esquerda! Precisamos nos unir e montar uma estratégia para combater a direita, pois se não, eles sairão vencedores e isso é inaceitável!!!
